content.css:
.info-container {
  height: 100%;
}
.info-message {
  vertical-align: middle;
  position: relative;
  top: 50%;
  transform: translateY(-50%);
  text-align: center;
  font-family: "Segoe UI", wf_segoe-ui_normal, helvetica, arial, sans-serif;
  font-size: 14px;
  padding: 10px;
}
.loader {
  border: 5px solid #d5d6d8;
  border-radius: 50%;
  border-top: 5px solid #555;
  width: 20px;
  height: 20px;
  display: inline-block;
  -webkit-animation: spin 1s linear infinite;
  animation: spin 1s linear infinite;
}
/* Safari */
@-webkit-keyframes spin {
  0% {
    -webkit-transform: rotate(0deg);
  }
  100% {
    -webkit-transform: rotate(360deg);
  }
}
@keyframes spin {
  0% {
    transform: rotate(0deg);
  }
  100% {
    transform: rotate(360deg);
  }
}
.error-indicator {
  width: 35px;
  height: 35px;
  display: inline-block;
}
.vbi-logo {
  width: 35vh;
  height: 13vh;
  max-width: 93px;
  max-height: 30px;
}
.vbi-logo-gray {
  background-image: url('data:image/png;base64,');
}
.vbi-logo-color {
  background-image: url('data:image/png;base64,');
}
.background-image {
  background-repeat: no-repeat;
  background-size: contain;
}
.editor-icon {
  top: 0px !important;
  width: 38px;
  height: 38px;
  border-radius: 50%;
  margin-bottom: 10px;
  background-color: #f2c811;
  box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19);
}
.editor-icon:hover {
  box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.14), 0 6px 20px 0 rgba(251, 251, 251, 0.89);
}
.editor-icon img {
  border-style: none;
  width: 17px;
  position: relative;
  top: 11px;
  left: 11px;
}
.close-icon .edit-icon-img {
  display: none !important;
}
.edit-icon .close-icon-img {
  display: none !important;
}
.modal-close-button {
  height: 13px;
  width: 12px;
  right: 4px;
  position: absolute;
  top: 2px;
  z-index: 60;
}
.close-icon-2 {
  background-image: url('data:image/png;base64,');
}
.close-icon-2:hover {
  background-image: url('data:image/png;base64,');
}
.vbi-info-icon {
  width: 40px;
  height: 40px;
  margin: 0 auto;
  background-color: rgba(255, 255, 255, 0.75);
  background-image: url("data:image/svg+xml;base64,");
}
.vbi-info-icon.edit-mode {
  background-image: url("data:image/svg+xml;base64,");
}
.resize-chart {
  height: calc(100% - 40px) !important;
}
.vbi-smoke-screen .modal-close-button {
  display: none !important;
}
.vbi-license-alert-icon {
  width: 16px;
  height: 16px;
  position: absolute;
  margin: 0 auto;
  right: 15px;
  background-image: url('data:image/png;base64,');
}
.vbi-license-alert-icon:hover {
  background-image: url('data:image/png;base64,');
}
.vbi-info-icon:hover {
  background-image: url("data:image/svg+xml;base64,");
  opacity: 0.5;
}
.vbi-info-icon.edit-mode:hover {
  background-image: url("data:image/svg+xml;base64,");
  opacity: 1;
}
@media (max-width: 231px), (max-height: 151px) {
  .vbi-logo {
    width: 40px;
    height: 15px;
  }
  .vbi-logo-gray {
    width: 40px;
    height: 15px;
    background-image: url('data:image/png;base64,');
  }
}
@media screen and (max-height: 245px) {
  .vbi-license-modal {
    height: 150px !important;
  }
}
.vbi-smoke-screen .vbi-logo-color {
  background-image: url('data:image/svg+xml;base64,');
}
.vbi-error-url a {
  text-decoration: underline;
  color: #f2c811;
}
.vbi-smoke-screen .vbi-error-url a {
  color: blue;
}
.right-bottom-ps {
  position: absolute;
  bottom: 4px;
  right: 4px;
}
.right-top-ps {
  position: absolute;
  z-index: 10;
  top: 4px;
  right: 4px;
}
.vbi-smoke-screen {
  width: 100%;
  bottom: 0;
  position: absolute;
  background: rgba(250, 250, 250, 0.1);
  z-index: 999;
}
.vbi-smoke-screen .error-span {
  font-size: 20px;
}
.resize-chart {
  width: calc(100% - 400px);
  left: 400px;
}
.remove-resize-chart {
  width: 100% !important;
  left: 0% !important;
}
.infiniteBottom {
  top: 1000000px !important;
}
.plot-area {
  position: absolute;
  width: 100%;
  height: 100%;
  top: 0%;
}
.editor--show {
  display: block;
}
.vbi-kpi-tile .kpi-label {
  font-size: 15vh;
  font-weight: 100;
  color: #888484;
}
.vbi-kpi-tile .kpi-value {
  font-size: 20vh;
}
.vbi-show-landing-page {
  width: 100%;
  height: 100%;
  min-width: 500px;
  min-height: 400px;
  vertical-align: middle;
